import React from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';
import { useSpring, animated } from 'react-spring';
import 'bootstrap/dist/css/bootstrap.min.css';

const Biosensing = () => {
  const fadeIn = useSpring({
    from: { opacity: 0 },
    to: { opacity: 1 },
    config: { duration: 1000 },
  });

  return (
    <animated.div className="cover-container d-flex w-100 h-100 p-3 mx-auto flex-column" style={fadeIn}>
      <header className="mb-auto">
        <div>
          <h3 className="float-md-start mb-0">Biosensing Project</h3>
        </div>
      </header>

      <main className="px-3">
        <h1>Biosensing Innovations</h1>
        <p className="lead">
          Explore the cutting-edge biosensing technologies developed in our nanotechnology lab.
        </p>

        <Row>
          {/* Card 1 */}
          <Col md={6} className="mb-4">
            <Card>
              <Card.Img variant="top" src="card_image_1.jpg" className="smaller-image" alt="Card 1" />
              <Card.Body>
                <Card.Title className="bigger-text">Project Aspect 1</Card.Title>
                <Card.Text className="bigger-text">
                  Description of the first aspect of the biosensing project.
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>

          {/* Card 2 */}
          <Col md={6} className="mb-4">
            <Card>
              <Card.Img variant="top" src="card_image_2.jpg" className="smaller-image" alt="Card 2" />
              <Card.Body>
                <Card.Title className="bigger-text">Project Aspect 2</Card.Title>
                <Card.Text className="bigger-text">
                  Description of the second aspect of the biosensing project.
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>

          {/* ... (rest of the cards remain the same) */}
        </Row>
      </main>

      <footer className="mt-auto">
        <p>Â© 2024 Your Lab Name</p>
      </footer>
    </animated.div>
  );
};

export default Biosensing;
